import React from 'react';
import logo from './logo.png';
import { Container, Row, Col } from 'reactstrap';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          We have raised RM50,000 for the marginalized youth
        </p>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <Container >
          <Row xs='3' className="Icons">
            <Col >instagram</Col>
            <Col >whatsaoo</Col>
            <Col >email</Col>
          </Row>
        </Container>
      </header>

    </div >
  );
}

export default App;
